Every ones a little rough on the NEWB. No one knew any of this when they started and someone had to teach you.
@Dark Droid, bro you gotta learn to Google and ask questions, especially before putting yourself on Blast by commenting on something someone is sharing. 2 things either wiki torrent files or use the guide on Utorrent to understand what your using and how to use it. 2nd before downloading a torrent look at how long its been posted (longer the better) and how many times its been downloaded as well others comments on the file. Lastly AV programs are not full proof and almost ANY thing with a keyogen or a serial will come up as virus. FYI - Norton is the worst, its a borderline virus itself. Your gonna have problems removing it and I recommend you do that before installing this.
Anyone have comments for me, save them and I'll send you my address. You can say what you'd like in person instead of behind a keyboard.
